import React from 'react'

class LogInForm extends React.Component {

   render(){
      return (
         <form className="login-form">
            <label>
               Log in:
               <input type="textarea"/>
            </label>
            <label>
               Sign in:
               <input type="textarea"/>
            </label>
         </form>
      )
   }
}

export default LogInForm
